import React, {Component} from 'react';
import './aboutUs.css';

class AboutUs extends Component {
  constructor(){
    super();
    this.state = {};
  }
  render(){
    return(
      <div class="wrapper">
        <h1 className="team_header">MEET OUR TEAM</h1>
        <p className="team_description">We are all very different. We were born in different cities, at different times, we love different music, food, movies. But we have something that unites us all. It is our company. We are its heart. We are not just a team, we are a family.</p>
      </div>
    )
  }
}

export default AboutUs;
